import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import favicon from '../../assets/images/favicon.png'
import guser from '../../assets/images/guser.png'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'


const MainWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  height: 100vh;
  width: 100%;
  background-color: red;
`
const SubWrapper1 = styled.div`
  width: 400px;
  background-color : ${properties.white};
  display: flex;
  flex-direction: column;
  align-items: center;
  @media (max-width: 500px) {
  width: 65%;
}
`
const SubCol1 = styled.div`
  width: 70px;
  height: 70px;
  background-image: url(${props => props.favicon});
  background-size: cover;
`
const SubCol2 = styled.div`
  width: 300px;
  height: 60%;
  display: flex;
  flex-direction: column;
  margin: 24px ;
  padding: 0px 24px;
  padding-bottom: 24px;
  border: 1px solid rgba(0, 40, 100, 0.12);

`
const UserDetail = styled.div`
  width: 50%;
  display: flex;
  flex-direction: column;
`
const InsideCol = styled.div`
  width: 100%;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  margin-top: 15px;
  @media (max-width: 500px) {
  display: flex;
  flex-direction: col;
  justify-content: center;
  align-items: center;
}
`

const InsideRow = styled.div`
  width: 60%;
  height: 145px;
  border: 1px solid rgba(0, 40, 100, 0.12);
  /* margin-left: 20px; */

`
const InsideImage = styled.div`
  width: 93px;
  height: 93px;
  background-image: url(${props => props.guser});
  background-size: cover;
  background-repeat: no-repeat;
`
const InsideText = styled.div`
  width: inherit;
  height: auto;
  text-align: center;
`

class Register extends Component {
  render() {
    return (<div>


      <MainWrapper >
        <SubWrapper1 >
          <SubCol1 favicon={favicon} />
          <SubCol2>
            <InsideCol color={properties.littleLightGrey}
              fontSize={fSize.slarge}>


                Sign up

            </InsideCol>
            <InsideCol>
              <UserDetail>
                <InsideRow >
                  <InsideImage guser={guser} />
                  <InsideText>
                    <TextBox
                      color={properties.littleLightGrey}
                      fontSize={fSize.slarge}>
                      Guest User
                    </TextBox>
                  </InsideText>
                </InsideRow>
              </UserDetail>
              <InsideRow>
              </InsideRow>

            </InsideCol>
          </SubCol2>
        </SubWrapper1>
      </MainWrapper>


    </div >
    )
  }
}

export default Register
